VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Postoperative nausea and vomiting (PONV) is one of the most common adverse complications associated with anesthesia and after surgical procedures. PONV is related to patient dissatisfaction and can lead to several postoperative complications. This study aimed to examine the efficacy and safety of penehyclidine combined with antiemetics in preventing PONV. We searched English databases (including PubMed, Web of Science, Ovid Medline, Embase and Cochrane Library), Chinese electronic databases (including China National Knowledge Infrastructure, Wanfang, VIP, and Chinese Biomedical Literature) and trial registry databases to find randomized controlled trials researching the clinical validity of penehyclidine combined with antiemetics for PONV. The retrieval time was up to January 2025, without publication date restrictions. Articles published in the English and Chinese languages were considered. The primary outcome was the incidence of PONV within and over 24 hours postoperatively.', '{0.1215493381023407,0.22955740988254547,-0.07223179936408997,-0.3673410713672638,0.34846562147140503,0.6657448410987854,-0.4104732871055603,-1.4167158603668213,0.6099307537078857,-0.5443620085716248,-0.2523629069328308,0.046112459152936935,-0.08917354047298431,-0.5632054209709167,0.6535128355026245,0.2621534764766693,0.3971482217311859,0.22538241744041443,-0.13728287816047668,-0.06497463583946228,-1.0721619129180908,0.0966244488954544,0.3962884545326233,-0.27725961804389954,-0.1761930137872696,-0.33263099193573,-0.20959334075450897,-0.19808481633663177,-0.21735481917858124,-0.08237194269895554,0.019945314154028893,-0.3487693667411804,0.06686820834875107,-0.23677632212638855,-0.37376654148101807,0.07502470910549164,-0.16913895308971405,1.329933762550354,0.14152057468891144,0.2093476504087448,0.04899636656045914,0.5213988423347473,-0.24914288520812988,0.5235244631767273,0.4749792814254761,-0.9360841512680054,-0.377799868