VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'considered. The primary outcome was the incidence of PONV within and over 24 hours postoperatively. The secondary outcomes were the incidence of different severities of PONV, incidence of postoperative rescue antiemetic therapy and postoperative complications. Quality assessment was conducted with the Cochrane Collaboration’s risk of bias tool and grading of recommendations assessment, development and evaluation method. Subgroup analyses were performed according to the postoperative observation period. Trial sequential analysis was performed to validate the reliability of the primary outcome. Publication bias was assessed by funnel plots and Egger’s regression test. Sixteen randomized controlled trials comprising 1561 participants were included. Compared with the control group, penehyclidine combined with antiemetics provided a lower incidence of PONV (risk ratio [RR]: 0.65; 95% CI: 0.57–0.', '{0.2785327732563019,0.13031165301799774,-0.21182389557361603,-0.2898668348789215,0.09385289996862411,0.25819793343544006,-0.10360671579837799,-1.16764497756958,0.434614896774292,-0.48512426018714905,-0.4807184338569641,0.03144171088933945,-0.23175682127475739,-0.6889021396636963,0.7724504470825195,0.40472570061683655,0.287245512008667,0.429669052362442,0.17258872091770172,0.21156153082847595,-1.2485953569412231,0.009006837382912636,0.3579331934452057,-0.46611833572387695,-0.41701725125312805,-0.422387033700943,-0.41446712613105774,-0.0017394990427419543,0.01680426485836506,0.16424810886383057,-0.1107906922698021,-0.6419628262519836,0.08187258243560791,-0.40389227867126465,-0.34897032380104065,0.12302165478467941,-0.23860348761081696,1.0231190919876099,-0.19347338378429413,0.029324207454919815,0.1308092325925827,0.4260547161102295,0.03006376139819622,0.08936549723148346,0.4505750238895416,-1.0653952360153198,-0.34406131505966187,0.20043723285198212,-1.290626883506775,-0.6306239366531372,0.12495787441730499,