VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'combined with antiemetics provided a lower incidence of PONV (risk ratio [RR]: 0.65; 95% CI: 0.57–0.74;  Compared with antiemetics, penehyclidine combined with antiemetics could provide better prevention efficiency for PONV, with lower incidence of PONV, lower incidence of severe PONV over 24 hours postoperatively and lower incidence of postoperative rescue antiemetic therapy. Postoperative nausea and vomiting (PONV) defined as any nausea, and vomiting within the first 24 to 48 hours after surgery in inpatients, is one of the most common adverse complications associated with anesthesia and surgical procedures, and is strongly related to patient dissatisfaction. Combination therapy involving 2 or more antiemetics that act on different receptors for the prevention of PONV has been recommended by the Consensus Guidelines for the Management of PONV as a risk-based approach to PONV prophylaxis.', '{-0.23755182325839996,0.10226070135831833,-0.08216554671525955,-0.7532241940498352,0.29551181197166443,0.4787833094596863,-0.25697043538093567,-0.9719521999359131,0.549297034740448,-0.17832763493061066,0.03317776322364807,0.25565701723098755,0.003286809427663684,-0.8694120049476624,0.6928165555000305,0.4595136046409607,-0.07034625858068466,0.18416771292686462,0.4877367317676544,0.21103034913539886,-0.9365497827529907,0.1693819761276245,0.7000173926353455,-0.08863042294979095,-0.10806422680616379,0.0680609941482544,-0.3519132435321808,-0.497509241104126,-0.24641826748847961,0.10043251514434814,-0.28944313526153564,0.04617110639810562,-0.15621963143348694,-0.3360234797000885,-0.20712395012378693,-0.1306219846010208,0.19132797420024872,1.1439186334609985,-0.24477724730968475,0.036140717566013336,-0.015982383862137794,0.5663350224494934,-0.0062804496847093105,-0.07769321650266647,0.22890079021453857,-1.0391994714736938,-0.2961881756782532,-0.19947771728038788,-2.1750452518463135,0.10307461768388748,0.6532078981