VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'by the Consensus Guidelines for the Management of PONV as a risk-based approach to PONV prophylaxis. In recent years, progress has been made in the combination with antiemetic drugs, and anticholinergics have been used to reduce the incidence of PONV. Recent clinical studies have shown that penehyclidine for the prevention of PONV has made good progress in some surgical procedures, such as ophthalmology, laparoscopic bariatric surgery, gynecological laparoscopic surgery, thyroid surgery and stomatology surgery. This study was conducted in accordance with the Preferred Reporting Items for Systematic Reviews and Meta-Analyses guidelines, and the Cochrane Handbook for Systematic Review of Interventions.', '{-0.07877261191606522,-0.2353103905916214,-0.07971899956464767,-0.37563827633857727,0.4702426791191101,0.46850302815437317,0.03147919476032257,-1.0651731491088867,0.41045644879341125,-0.6525854468345642,-0.05948742479085922,-0.38742756843566895,-0.21169771254062653,-0.8303996920585632,0.0751960426568985,0.3451441824436188,-0.3761265277862549,0.4493643045425415,0.28091830015182495,0.10749474167823792,-1.0752307176589966,0.07593924552202225,0.009822496213018894,-0.4022926390171051,-0.5439357757568359,-0.1412854641675949,-0.3697824776172638,-0.017813269048929214,-0.0857844278216362,0.12123765796422958,-0.13605637848377228,-0.6018496155738831,-0.119935542345047,-0.15268456935882568,-0.3717246949672699,-0.4347018301486969,-0.17086048424243927,1.1546026468276978,-0.26035740971565247,0.10985609143972397,-0.04057718813419342,0.46872085332870483,-0.3223330080509186,-0.010909661650657654,-0.185270756483078,-0.694442629814148,-0.5199862718582153,0.4198029637336731,-1.426026463508606,-0.1124851182103157,0.3666536808013916,-0.3823144733905792,0.041048433631658554,-0.5467507243156433,-0.46705198287963867,-0.14606408774852753,0.2582698166370392,0.4181453287601471,0.3194824755191803,0.04612109065055847,-0.122799