VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'Types of studies: Randomized controlled trials (RCTs) published in English or Chinese were included. Studies with the following situations were excluded: studies that only compared the effectiveness of monotherapy with penehyclidine for PONV; studies without randomization for treatment; studies whose data could not be extracted for statistical analysis; and duplicate publications, editorials, letters, abstracts from conferences, reviews, and ongoing trials. Two authors (Hongwei Zhang and Jianqiao Zheng) were required to screen the retrieved studies independently. Briefly, all titles and abstracts identified in the search were carefully examined, duplicate studies and those that did not match the inclusion criteria were excluded. The same 2 authors (Hongwei Zhang and Jianqiao Zheng) read the full text of each remaining study to select any potentially relevant articles. Any disagreements were resolved through discussion and the involvement of a third reviewer (Lu Zhang).', '{0.29934513568878174,0.20826099812984467,0.5450463891029358,0.10438623279333115,0.37446361780166626,0.5068509578704834,-0.055541615933179855,-0.7228191494941711,0.49970442056655884,-1.1209768056869507,-0.4989061653614044,-0.5917524099349976,-0.35534122586250305,-0.3463291525840759,-0.15200720727443695,0.2563118636608124,0.26790517568588257,0.46271219849586487,-0.2705109715461731,0.5204307436943054,-1.054680585861206,-0.03217737749218941,-0.24439914524555206,-1.0587774515151978,-0.5723939538002014,-0.5875372290611267,-0.4253145754337311,0.3682504892349243,-0.15607492625713348,0.6669188737869263,-0.14159820973873138,-0.6609054803848267,-0.2973827123641968,-0.1070142313838005,-1.0009996891021729,-0.20500688254833221,-0.5407108068466187,1.2917373180389404,0.024001551792025566,-0.47509223222732544,-0.0858837217092514,0.6737457513809204,-0.31077128648757935,-0.07408824563026428,-0.12805111706256866,-0.6245136260986328,-0.255748510360