VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 19, 'ONV over 24 hours postoperatively, and a lower incidence of postoperative rescue antiemetic therapy. However, it was associated with a higher incidence of dry mouth, but did not increase the incidence of other anticholinergic-related complications. Penehyclidine combined with antiemetics resulted in a lower incidence of PONV both within and over 24 hours postoperatively. We speculated that the following reasons may be responsible. First, penehyclidine may reduce the vagal reflex, which may inhibit vagal afferent activation by acting on M1-type receptors to mitigate PONV. Second, penehyclidine can relieve gastrointestinal smooth muscle spasms by acting on M3 cholinergic receptors in the digestive glands and smooth muscle of the digestive tract, which is effective in reducing postoperative gastric intraluminal pressure.', '{0.07165908068418503,0.02224276214838028,-0.07800017297267914,-0.47790881991386414,0.14983050525188446,0.9039644598960876,-0.6007160544395447,-0.965430498123169,0.4960096776485443,-0.08314377814531326,0.19663994014263153,0.061977092176675797,0.28754758834838867,-1.0547593832015991,0.3372608721256256,0.5734966397285461,-0.4944770932197571,0.2850126624107361,0.36653682589530945,0.008975562639534473,-1.072609543800354,0.12120784819126129,0.5991353392601013,-0.4996253252029419,-0.3890763223171234,-0.16070227324962616,-0.0985175222158432,-0.394087553024292,0.006264118943363428,0.4617241621017456,-0.06600191444158554,-0.03728131204843521,-0.42585352063179016,-0.5517460703849792,0.18507786095142365,-0.06126601994037628,-0.44757336378097534,0.7997409105300903,-0.23907184600830078,0.2306903898715973,-0.08578844368457794,0.46274393796920776,0.10319288074970245,0.002494639018550515,0.2992170751094818,-1.6440510749816895,-0.6788692474365234,-0.349153071641922,-1.8449450731277466,-0.17761464416980743,0.8580023050308228,-0.1505877822637558,0.14232996106147766,-0.4858027696609497,-1.087879776