VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 20, 'of the digestive tract, which is effective in reducing postoperative gastric intraluminal pressure. Third, penehyclidine postconditioning could improve small intestinal mucosal injury and reduce damage to the barrier function of the small intestinal mucosa caused by limb ischemia-reperfusion. In addition, the elimination half-life of penehyclidine is approximately 24 hours, causing its preventive effect on PONV to diminish or disappear after 24 hours. Dry mouth symptoms were observed in 117 individuals (57.64%) in the Penehyclidine + Antiemetics group, which was significantly higher than that in the Antiemetics group (38 individuals; 18.63%). This could be attributed to its impact on type 3 muscarinic acetylcholine receptors, leading to reduced glandular secretion from respiratory submucosal glands.', '{0.10796089470386505,0.17438942193984985,-0.026291366666555405,-0.48603376746177673,0.4206851124763489,1.203194260597229,-0.42245742678642273,-0.7528287172317505,0.5861541628837585,0.0829375609755516,0.2996882498264313,0.6765881776809692,-0.0041402289643883705,-0.6741282343864441,0.22544196248054504,0.44180673360824585,-0.3593665063381195,-0.3323916792869568,0.2207057625055313,0.3284558951854706,-0.7922711372375488,-0.03728219121694565,0.5353405475616455,-0.5590750575065613,-0.2967463433742523,0.12185578793287277,0.06465237587690353,-0.08921795338392258,0.03050650656223297,0.6248958110809326,0.24362969398498535,-0.06727860867977142,-0.50550776720047,-0.08809224516153336,0.1564384549856186,-0.01101033017039299,-0.640385627746582,0.06458404660224915,-0.8468325734138489,0.04015611484646797,0.0119566535577178,0.1857312023639679,0.3268786072731018,0.20803608000278473,0.11353613436222076,-1.3779857158660889,-0.8398863673210144,-0.10029371827840805,-1.4624872207641602,-0.16713844239711761,0.4092419445514679,-0.09453762322664261,0.0216279998421669,-0.9005961418151855,-0.7136892080307007,0.461149364709854