VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 21, 'acetylcholine receptors, leading to reduced glandular secretion from respiratory submucosal glands. As a novel anticholinergic and highly selective antagonist of both type 3 and type 1 muscarinic acetylcholine receptors, penehyclidine has fewer adverse effects than other anticholinergics. No significant differences were found between the 2 groups regarding other anticholinergic-related side effects, such as headache, dizziness, fever or urinary retention. Delayed recovery of intestinal function and postoperative delirium (POD) are major concerns in the use of anticholinergic drugs. We also investigated the efficacy of penehyclidine combined with routine antiemetics in preventing PON and POV separately. Our meta-analysis revealed that, compared with monotherapy with antiemetics alone, penehyclidine combined with antiemetics provided a lower incidence of PON and POV.', '{0.47528019547462463,-0.18614117801189423,-0.01604684256017208,-0.4908056855201721,0.2657362222671509,0.9456337690353394,-0.6114657521247864,-0.941215455532074,0.6189363598823547,-0.2191668301820755,0.01156272366642952,0.6307295560836792,0.20344588160514832,-0.4612875282764435,0.04265029355883598,0.5970970988273621,-0.30062276124954224,0.5022544860839844,0.466094046831131,0.292781800031662,-0.9853259325027466,-0.1309639811515808,0.3017491400241852,-0.7092796564102173,-0.6106370687484741,0.18933618068695068,-0.28141364455223083,0.20932704210281372,-0.07009433954954147,0.07242602109909058,0.04166506975889206,-0.360180526971817,-0.09572794288396835,-0.317995548248291,0.206848606467247,0.025709373876452446,-0.5711202621459961,0.8611315488815308,-0.45654410123825073,-0.1860417127609253,-0.34726864099502563,0.6192615032196045,0.34204208850860596,-0.22235889732837677,0.42455559968948364,-1.513366937637329,-0.4331579804420471,-0.26326775550842285,-1.2388309240341187,-0.3314880132675171,0.8683666586875916,-0.14068198204040527,0.24211661517