VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 22, 'ntiemetics alone, penehyclidine combined with antiemetics provided a lower incidence of PON and POV. However, few trials have contributed data to the subgroup analysis of the incidence of PON and POV, indicating that subgroup analysis may not be able to detect the advantages of penehyclidine combined with antiemetics because of the insufficient sample size. Moreover, penehyclidine could play a role in preventing PONV by blocking both the type 1 and type 3 muscarinic acetylcholine receptors, which play important roles in the pathogenesis of PONV. The risk factors for PONV included female sex, inhaled anesthesia for >60 minutes, high-risk procedures (cholecystectomy, laparoscopic, gynecologic), and age < 50 years. For the primary outcome, TSA was performed to test the validity, and publication bias was assessed to assess the stability. In addition, GRADE was performed to test the quality evidence of all the outcomes.', '{0.3339589834213257,0.11195121705532074,0.02398880571126938,-0.3551037609577179,0.17997050285339355,0.5378220081329346,-0.3913317620754242,-1.129262924194336,0.40725570917129517,-0.45836931467056274,-0.14194664359092712,0.29368799924850464,0.04140303656458855,-0.6296992301940918,-0.13069984316825867,0.3208718001842499,-0.4388487935066223,0.25429990887641907,-0.0666332021355629,0.39933013916015625,-1.2361170053482056,-0.31547412276268005,0.39624834060668945,-0.8075472116470337,-0.6800506711006165,-0.2214607447385788,-0.2003946155309677,0.1453588455915451,0.020412825047969818,0.4403272271156311,-0.3429655134677887,-0.7032610177993774,-0.06688158214092255,-0.41413554549217224,-0.3339477479457855,-0.13375160098075867,-0.5416158437728882,1.1530872583389282,-0.30149659514427185,-0.29099157452583313,-0.393218457698822,0.7819451093673706,-0.05609869584441185,-0.13935869932174683,-0.10016324371099472,-1.3489376306533813,-0.6746468544006348,0.2084888070821762,-1.118190884590149,-0.222369015