VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 23, 'ss the stability. In addition, GRADE was performed to test the quality evidence of all the outcomes. The TSA of the pooled meta-analysis revealed strong evidence that penehyclidine combined with antiemetics provided a lower incidence of PONV within 24 hours postoperatively, and that evidence for the incidence of PONV over 24 hours postoperatively was uncertain. Significant publication bias was indicated, and trim-and-fill analysis was performed to reduce and adjust for publication bias. Fortunately, the correction for potential publication bias did not materially alter the stability of the results. The results of the GRADE analysis indicated that the evidence quality of the outcomes was low to very low, indicating that the clinical value of penehyclidine combined with antiemetics in preventing PONV is limited. Therefore, more RCTs are required in the future to improve the evidence quality of the results.', '{0.2613202929496765,-0.03837063908576965,-0.217561274766922,-0.316684752702713,0.3447796702384949,0.1309085190296173,-0.1628773808479309,-1.2851004600524902,0.22479869425296783,-0.6325179934501648,-0.3725182116031647,-0.16897596418857574,-0.265194833278656,-0.5340761542320251,0.4605690836906433,0.4969743490219116,0.07375860214233398,0.3401598632335663,-0.10590308159589767,0.6280049085617065,-1.1083948612213135,0.09297323226928711,0.42750293016433716,-0.6578361988067627,-0.30616095662117004,-0.2744164764881134,-0.1989445984363556,0.02835940197110176,-0.15287800133228302,0.16957496106624603,-0.16993635892868042,-0.4149489998817444,-0.03564045950770378,-0.8585651516914368,-0.6485507488250732,-0.307261198759079,-0.1611846685409546,0.9365308284759521,-0.12317537516355515,0.0029088868759572506,0.2959713041782379,0.6775684952735901,-0.1080094575881958,0.22424007952213287,0.2693016529083252,-1.0339860916137695,-0.7608446478843689,0.32150277495384216,-1.1747161149978638,-0.4894130527973175,0.30198788