VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 24, 'ted. Therefore, more RCTs are required in the future to improve the evidence quality of the results. To the best of our knowledge, this is the first meta-analysis pooling and analyzing the efficacy and safety of penehyclidine combined with antiemetics for PONV. For the primary outcome, TSA was performed to test the validity, and publication bias was assessed by visual judgment of the funnel plot asymmetry, Egger’s regression test, and trim-and-fill analysis to check the stability of the primary outcome. In addition, GRADE was performed to test the evidence quality of all the outcomes. There are also limitations to our analysis. First, the number of studies with eligible data was limited, and the sample size of each included study was small. Potential heterogeneity could exist, which could result in inadequate statistical power for the outcomes. Therefore, TSA was performed as an additional statistical analysis for the primary outcome.', '{0.2938942313194275,-0.005200261250138283,-0.044410087168216705,-0.09350195527076721,0.29199662804603577,0.02868887223303318,0.2585862874984741,-1.1607630252838135,0.20975296199321747,-0.800036609172821,-0.9414571523666382,-0.0963696539402008,-0.0019398934673517942,0.013512033969163895,0.2971019744873047,0.38337329030036926,-0.010612786747515202,0.3757035434246063,-0.17422419786453247,0.6140590310096741,-1.1095842123031616,0.01207334641367197,0.054516807198524475,-0.7888144850730896,-0.3793500065803528,-0.31157299876213074,-0.29509174823760986,0.21459674835205078,-0.0015542596811428666,-0.08648349344730377,-0.17939424514770508,-0.02991294674575329,0.2871735692024231,-0.6323002576828003,-0.5693381428718567,-0.3829939663410187,-0.3970460593700409,1.0453227758407593,-0.21338538825511932,-0.7288803458213806,0.32515084743499756,0.8157517910003662,-0.3048816919326782,-0.04752819985151291,0.10706230252981186,-0.9423618912696838,-0.7546838521957397,0.5689306855201721,-