VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Stroke is a leading cause of disability, significantly impacting mobility. Effective rehabilitation depends on accurate predictors of recovery. Recent studies suggest that both cognitive function and certain initial laboratory biomarkers, such as alanine aminotransferase (ALT), could be crucial for predicting recovery outcomes. This study investigates how cognitive function and ALT levels can predict functional ambulation in survivors of middle cerebral artery stroke. A retrospective analysis was conducted on 87 patients who began rehabilitation within 30 days of their first middle cerebral artery stroke. Multivariate logistic regression was employed to identify predictors of ambulation recovery. The variables assessed included age, sex, National Institutes of Health Stroke Scale, Berg Balance Scale, Mini-Mental State Examination, and extremely low ALT levels.', '{0.06421772390604019,0.3481125235557556,0.381155401468277,-0.5793301463127136,0.22645646333694458,0.22020086646080017,0.14750270545482635,-0.6048966646194458,-0.3010595142841339,-0.16097354888916016,-0.46429765224456787,-0.1734379082918167,-0.3266436457633972,0.6770775318145752,0.6743094325065613,0.04059431701898575,0.5743293762207031,0.0707521066069603,-0.8747043013572693,0.3729146122932434,-0.7776792645454407,-0.38671138882637024,0.6557302474975586,0.33146294951438904,-0.5848124623298645,0.4873090386390686,0.39865297079086304,0.16944849491119385,0.11922122538089752,-0.5331825017929077,0.24632568657398224,0.08800885826349258,-0.9226930737495422,-0.9121024012565613,-0.4730997383594513,0.6009405255317688,0.14732523262500763,-0.8922955989837646,0.8150412440299988,0.00989000778645277,0.13164211809635162,0.3305276036262512,-0.35863232612609863,-0.9448802471160889,0.40356573462486267,-0.40147197246551514,-0.3955642282962799,0.08029971271753311,-0.7874351143836975,0.5325049161911011,-0.19046400487422943,-0.3510279357433319,0.39729952812194824