VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'filiated hospital. Given its retrospective nature, the need for written informed consent was waived. This research was conducted using a retrospective analysis of electronically documented medical records, employing data derived from routine clinical evaluations and assessments performed during standard care protocols. The Functional Ambulation Classification (FAC) tool was utilized as the primary criterion for assessing ambulation, ensuring consistent evaluation across different studies and enhancing the comparability and reliability of results. Balance, encompassing both fundamental lower limb motor functions and proprioceptive aspects, was identified as a critical body function for functional ambulation. Thus, the Berg Balance Scale (BBS) was chosen as a key predictor due to its comprehensive assessment of balance, which is essential for evaluating functional ambulation outcomes.', '{-0.5172032117843628,0.2477453052997589,0.26859050989151,0.13352642953395844,0.10415519773960114,-0.669977605342865,0.11662602424621582,-0.41357535123825073,-1.0937690734863281,-0.5052014589309692,-0.29619720578193665,-0.5346213579177856,-0.31414783000946045,0.1697661131620407,0.925812840461731,-0.2237234115600586,0.38634157180786133,0.08959567546844482,-0.8049713969230652,-0.2582628130912781,-0.6340415477752686,-0.40802058577537537,0.31052282452583313,0.0442565456032753,0.42413026094436646,0.48168835043907166,0.2784733176231384,0.4661130905151367,0.9438804984092712,-0.2263757586479187,0.37842416763305664,-0.9034572243690491,-0.2781808078289032,-0.8327420353889465,0.09370660781860352,0.4207659363746643,0.7019709944725037,-0.2274717539548874,-0.4121840000152588,-0.06278166174888611,-0.17604570090770721,0.9500643610954285,-0.4211360514163971,-1.47894287109375,-0.2686223089694977,-0.37751129269599915,-0.4340302050113678,0.1067056804895401,-0.4556114971637726,0.5357359647750854,-0.057873085141181946,0.0038620010018348