VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'mprehensive assessment of balance, which is essential for evaluating functional ambulation outcomes. Cognitive function, which has been widely studied for its influence on post-stroke recovery of walking ability, was assessed using the Mini-Mental State Examination (MMSE). Regarding the inclusion of laboratory findings, routine blood tests conducted during the acute phase of stroke were retrospectively collected and analyzed for their prognostic significance. This approach focused on blood test results from the time of stroke onset to identify biomarkers that could influence clinical outcomes and prognosis. Creatinine was included due to its well-documented association with functional outcomes post-stroke, serving as a covariate to adjust for its prognostic influence. This retrospective chart review study was performed in line with the principles of the Declaration of Helsinki.', '{0.1627577841281891,-0.15237921476364136,0.49557358026504517,-0.4792032837867737,0.06505297869443893,-0.1394343078136444,0.2019655555486679,-0.13370580971240997,-0.5414525270462036,-0.61868816614151,-0.5440245866775513,-0.015389596112072468,-0.7414220571517944,0.29599225521087646,0.6642856597900391,0.06098773330450058,1.369491457939148,-0.019864974543452263,-0.3177918493747711,0.1994187980890274,-0.3460724651813507,-0.5418270826339722,-0.031034383922815323,-0.0030054592061787844,0.1759544014930725,0.5289496183395386,0.38462603092193604,0.3243464529514313,0.5521928668022156,-0.5060452222824097,-0.24396970868110657,-0.24610693752765656,-0.7166485786437988,-0.5760223865509033,-0.02104618214070797,0.3954581320285797,-0.2967759370803833,-0.21875619888305664,-0.4089714288711548,-0.42900532484054565,-0.08306699246168137,0.10130392014980316,0.12131647765636444,-0.963428258895874,0.4453704059123993,-0.5123146772384644,-0.7887269258499146,-0.024654757231473923,-0.44171440601348877,-0.1410508155822754,0.2816656529903412,-0.341692