VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 's study focused only on subjects with hemiplegic MCA stroke who were not initially able to ambulate. Patients were excluded from the study if they (1) had musculoskeletal disorders that could influence their gait; (2) presented with quadriplegia due to bilateral brain involvement; (3) had a concurrent stroke in regions other than the MCA; (4) had liver disease or an ALT level exceeding 40 U/L; or (5) could ambulate functionally from the initial assessment, including those with a FAC scale of 3 or higher. A total of 87 subjects were included in the retrospective analysis. The primary outcome was whether functional ambulation was achieved after short-term (1–2 months) subacute rehabilitation assessed using FAC.', '{0.03926686570048332,0.4765126407146454,0.6348292827606201,-0.4159104526042938,0.12925384938716888,-0.03322281688451767,0.056130968034267426,-0.47254425287246704,-0.6399458050727844,-0.5175043940544128,-0.173089399933815,0.013776147738099098,-0.7285175323486328,0.1695878654718399,0.7827585339546204,-0.1914052516222,0.5045045018196106,-0.3760501742362976,-0.8341003060340881,0.19100119173526764,-1.1162768602371216,-0.2744201123714447,0.9448574781417847,-0.31845957040786743,-0.4935353994369507,0.6932522654533386,0.039440419524908066,1.02884042263031,1.0937738418579102,0.28326860070228577,0.170965775847435,0.5027986168861389,-1.298633337020874,-0.33106729388237,-0.3262943923473358,0.005790289491415024,-0.4443436563014984,-0.9530544877052307,0.2831154763698578,-0.039254724979400635,0.2834782004356384,0.2725595235824585,-0.7102128863334656,-1.0789401531219482,0.31028780341148376,-0.2574855089187622,-0.465459942817688,0.12110587954521179,-0.1390562504529953,0.21801477670669556,-0.18720188736915588,-0.28934013843536377,0.2056647539138794,0.3565034866333008,0.41315382719039917,0.42935553193092346,0.5818566083908081,-0.5258126854896545,0.3396691381931305,-0.005809744819998741,0.3915620446205139,0.