VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, 'al ambulation was achieved after short-term (1–2 months) subacute rehabilitation assessed using FAC. The FAC scale evaluates ambulation ability, with scales defined as follows: FAC 0 indicates non-ambulatory status; FAC 1 requires assistance for a few steps; FAC 2 allows independent walking for short distances but needs help for longer distances or uneven surfaces; FAC 3 signifies independent ambulation on flat surfaces, with possible assistance needed for stairs; FAC 4 denotes independent walking in all situations, including stairs and uneven terrain; and FAC 5 represents full independence in any environment. Among the covariates, basic clinical data included age, sex, and comorbidities. The Charlson Comorbidity Index (CCI) was used as a covariate to adjust for the impact of comorbidities on post-stroke ambulation function recovery.', '{-0.1306936889886856,0.18796542286872864,0.44083258509635925,-0.1459393948316574,-0.26583075523376465,0.15625250339508057,0.21054863929748535,-0.10406995564699173,-0.7581215500831604,-0.34854501485824585,-0.20897001028060913,-0.06165025383234024,-0.7761368751525879,0.04935162141919136,1.376089334487915,-0.24714958667755127,0.3550068140029907,-0.3232022523880005,-0.3381096422672272,0.26686277985572815,-0.9469860196113586,-0.23462840914726257,0.1969577968120575,-0.3863924443721771,-0.19449804723262787,1.0630741119384766,0.013342131860554218,1.151723027229309,1.1452668905258179,-0.0021997657604515553,0.08458728343248367,0.534810483455658,-0.9049859642982483,-0.3473407030105591,-0.33802416920661926,0.09833294153213501,-0.09464912861585617,-1.1675301790237427,-0.1842564344406128,0.4510393440723419,0.4424530267715454,0.5392303466796875,-1.0059062242507935,-1.4142106771469116,0.00967472791671753,-0.37458887696266174,-0.3059156537055969,-0.5080151557922363,-0.6379883885383606,-0.11041424423456192,0.1888677179813385,-0.183290496468544,0.6273910999298096,0.2223103642463684