VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 's a covariate to adjust for the impact of comorbidities on post-stroke ambulation function recovery. Among the covariates, clinical indicators related to stroke were investigated as type of stroke (hemorrhagic or ischemic) and location of brain lesion (left or right), initial NIHSS as the initial severity of the stroke. The BBS is a clinical assessment tool with a maximum score of 56, with higher scores indicating better balance ability. Routine laboratory biomarkers included as covariates were creatinine for renal function, albumin and hemoglobin for nutritional status, ALT for its potential link to frailty. We specifically focused on initial cognitive function, balance ability, and extremely low ALT levels as key covariates in predicting functional ambulation acquisition. To assess these predictors, we converted them into binary variables for a binary logistic regression model.', '{0.08276426792144775,0.3424040675163269,0.538187563419342,-0.5313664674758911,-0.1299329400062561,-0.319840669631958,0.3768010139465332,-0.05893414467573166,-0.870546281337738,-0.3701721727848053,-0.5771556496620178,-0.05830391123890877,-0.7586938142776489,0.1905437409877777,0.8858575224876404,-0.11452233791351318,0.588481605052948,0.13492515683174133,-0.5846583247184753,0.6477125883102417,-0.8578187227249146,-0.3260745406150818,-0.028689175844192505,-0.13452348113059998,-0.5141299366950989,0.8839987516403198,0.3843481242656708,0.666486918926239,0.7352203130722046,-0.403115838766098,0.06391856074333191,0.014564636163413525,-0.2689353823661804,-0.580496072769165,-0.05788979306817055,0.5215867757797241,-0.10994457453489304,-0.701164722442627,-0.04198908060789108,0.3935486376285553,0.13568411767482758,0.5504462122917175,-0.4631098806858063,-1.6226160526275635,0.0007942089578136802,-0.6628292798995972,-0.773827075958252,-0.17339704930782318,-0.2762843370437622,0.34447968006134033,-0.02467990852892399,-0.4695660471916199