VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 16, 'cognitive and balance function, while extremely low serum ALT levels were linked to poorer outcomes. The integration of routinely measured laboratory biomarkers into this analysis enhances its clinical relevance, as these markers are readily available at the time of stroke diagnosis. For instance, ALT and albumin levels, although traditionally associated with liver function and nutritional status respectively, may also reflect broader systemic conditions like frailty, sarcopenia, and overall physical resilience, which are critical in the context of stroke recovery. The relevance of ALT, particularly its association with frailty, disability, and adverse outcomes, extends beyond traditional hepatic concerns. Low ALT levels have emerged in recent literature as markers of frailty and poor survival in elderly populations. Routine laboratory biomarkers were included in this analysis due to their potential clinical utility in prognosis.', '{0.07773136347532272,-0.343564510345459,0.8109361529350281,-0.7006491422653198,-0.5096668601036072,-0.5313559770584106,-0.1452721655368805,0.463255912065506,-0.4782073199748993,-0.28142887353897095,-0.6697052121162415,-0.27179259061813354,-0.06341888755559921,0.5533148050308228,0.6287637948989868,-0.17443983256816864,0.3196488916873932,-0.10949081927537918,-0.19268681108951569,0.09635064750909805,-0.3550693988800049,-0.3636404871940613,0.02280408702790737,-0.07407549768686295,-0.10452184826135635,0.6073386073112488,0.19503232836723328,-0.10472873598337173,0.4266284704208374,-1.189575433731079,-0.4454115331172943,-0.10805747658014297,-0.8286986947059631,-0.7979710102081299,-0.36002641916275024,0.17761394381523132,-0.2681119740009308,-0.6608007550239563,-0.9344937205314636,-0.5105836391448975,0.33770251274108887,-0.01638987846672535,-0.09213542193174362,-0.7749587297439575,0.08192235976457596,0.38092848658561707,-0.5338616967201233,0.002556061837822199,0.0007987875142