VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 20, 'ection bias. Another important limitation is the potential ambiguity in interpreting low ALT levels. While extremely low ALT is associated with frailty, it may also reflect other unmeasured confounders such as undiagnosed liver disease or variations in muscle mass. These factors could contribute to outcome differences and warrant careful consideration in interpreting our findings. Additionally, the study population was limited to patients from a single institution, which may affect the generalizability of the findings. Future studies should include prospective validation in larger, multicenter cohorts to confirm these associations and explore the potential dose–response relationship between continuous ALT levels and rehabilitation outcomes. Furthermore, targeted frailty interventions in patients with low ALT levels should be investigated to assess whether such approaches can enhance functional ambulation recovery.', '{0.17843103408813477,-0.1416500210762024,0.6192030310630798,-0.6550955772399902,-0.6197253465652466,-0.509710967540741,-0.36532819271087646,-0.22099536657333374,-0.532455325126648,0.11888507008552551,-0.3593687117099762,-0.22278326749801636,0.1640535593032837,0.4990231692790985,1.007822871208191,-0.3107526898384094,0.20523136854171753,-0.1021401435136795,-0.006784852594137192,0.15258468687534332,-0.9555959701538086,-0.17049147188663483,0.1464427262544632,0.15182805061340332,-0.14488185942173004,0.453801691532135,-0.18572527170181274,0.030744468793272972,0.8867491483688354,-0.5402695536613464,-0.13885819911956787,0.026974724605679512,-0.22226393222808838,-1.1725915670394897,-0.0705285370349884,0.2586585581302643,-0.1350110024213791,-1.0643556118011475,-0.9706205725669861,-0.25383391976356506,-0.12461208552122116,0.4039742350578308,-0.10319135338068008,-1.1638767719268799,-0.16814641654491425,0.4423299729824066,-0.25915172696113586,-0.26016008853912354,-0.453500896692276,0.6886543035